import React from 'react';
import Tarjeta from '../elementos/Tarjeta';

const productos = [
  { id: 1, nombre: 'Producto 1', descripcion: 'Descripción del producto 1', precio: 100, imagen: 'https://www.dafiti.com.co/3-Pack-De-Boxer-En-Algodon-Low-Rise-Trunk-Para-Hombre-Calvin-Klein-1791576.html' },
  { id: 2, nombre: 'Producto 2', descripcion: 'Descripción del producto 2', precio: 200, imagen: '.../i' },
  { id: 3, nombre: 'Producto 3', descripcion: 'Descripción del producto 3', precio: 300, imagen: 'url-imagen-3.jpg' },
   { id: 1, nombre: 'Producto 4', descripcion: 'Descripción del producto 4', precio: 100, imagen: 'url-imagen-1.jpg' },
  { id: 2, nombre: 'Producto 5', descripcion: 'Descripción del producto 5', precio: 200, imagen: 'url-imagen-2.jpg' },
  { id: 3, nombre: 'Producto 6', descripcion: 'Descripción del producto 6', precio: 300, imagen: 'url-imagen-3.jpg' },
];

const Catalogo = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h2>Catálogo de Productos</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {productos.map(producto => (
          <Tarjeta
            key={producto.id}
            imagen={producto.imagen}
            nombre={producto.nombre}
            descripcion={producto.descripcion}
            precio={producto.precio}
          />
        ))}
      </div>
    </div>
  );
};

export default Catalogo;
